import { useStore, actions } from "./store"

export const GlobaState = ()=>{
    const [state, dispatch] = useStore(useStore)
    const {todos, todoInput} = state
    return(
        <div>
            <input 
                value={state.todoInput}
                placeholder ="Enter todo ..."
                onChange={e => {
                    dispatch(actions.setTodoInput)
                }}
            />
        </div>
    )
}
